#include <iostream>
#include <map>

	using namespace std;
    int lengthOfLongestSubstring(string s) {
    	// if(!s.length()) return 0;
        map<char, int> histogram;
        int res = 0;
 		int i = 0;
 		while(i < s.length()) {
 			char c = s.at(i);
 			if(histogram.find(c) != histogram.end()) {
 				// cout<<c<<i<<","<<
 				if(histogram.size() > res) {
 					res = histogram.size();
 				}
 				i = histogram[c] + 1;
 				histogram.clear();
 			} else {
 				histogram[c] = i;
 				i++;
 			}
 		}
 		if(histogram.size() > res) {
 			res = histogram.size();
 		}
        return res;
    }
